function collision()

 solids[182] = true

 
 --pipessss

 if pipe(p.x+2,p.y+p.vy) then
  p.inpipe = true
  p.vy=0
  p.vx=0
  p.x = (p.x+2)//8*8
  p.pipedir = "up"
  p.lastdir = 0
 --check 2 more points on bonk entry
 --to improve game feel
 elseif pipe(p.x+4,p.y-4) then
  p.inpipe = true
  p.vy=0
  p.vx=0
  p.x = (p.x+4)//8*8
  p.pipedir = "up"
  p.lastdir = 0
 elseif  pipe(p.x+6,p.y+p.vy) then
  p.inpipe = true
  p.vy=0
  p.vx=0
  p.x = (p.x+6)//8*8
  p.pipedir = "up"
  p.lastdir = 0
  
 --check entry at feet
 elseif pipe(p.x+4,p.y+8+p.vy) then
  p.inpipe = true
  p.vy=0
  p.vx=0
  p.y = p.y+2
  p.x = (p.x+4)//8*8
  p.pipedir = "down"
  p.lastdir = 0
 end
 
 
 if p.inpipe == true then
  local tile
	 tile = mget((p.x)//8,
	             (p.y)//8+(level-1)*34)
 
  if tile == 25 or tile == 41 
  or tile == 31 or tile== 45 
  or tile == 26 or tile == 46 then
   p.y=p.y-3
    
   --go up
   p.pipedir = "up"
   p.lastdir = -1
   
  elseif tile == 9 or tile == 10 
  or tile == 29 or tile == 42 
  or tile == 46 or tile == 47 then
   p.x=p.x+1
   -- go right
   p.pipedir = "right"
   
  elseif tile == 11
  or tile == 27 
  or tile == 28 
  or tile == 14 
  or tile == 15 
  or tile == 43 then
   p.y = p.y+1
   p.pipedir = "down"
   p.lastdir = 1
   
  elseif tile == 12 or tile == 13 
  or tile == 44 or tile == 30 then
   p.x = p.x-1
   p.pipedir = "left"

  else 
  --exit pipe
   if p.pipedir == "up"  then
	   p.x = p.x//8*8
	   p.y = p.y//8*8
				p.vy = -2
	  elseif p.pipedir == "down" then
    --entering the pipe breaks 
    --if I add any more in the exit code
				p.y = p.y-6
				p.vy = 2
			elseif p.pipedir == "left" then
			 p.x = p.x//8*8+2
	   p.y = p.y//8*8
				p.vx = -2
			
			elseif p.pipedir == "right" then
				p.x = p.x//8*8
	   p.y = p.y//8*8
				p.vx = 2
		  
	  end
   p.inpipe = false
  end 
 end
 
 --acid
 if world == 7 then
  if mget((p.x+4)//8,(p.y+7)//8+(level-1)*34) == 68 then
   death(false)
  end
 end
 
 --checkpoint flags
 
