function savegame()
 trace("Saving")
 pmem(0,basiccoins)
 
 for i=1,#records do
  local spc=0
  if spcoins[i] == true then 
   spc = 999999 
  end
  --spc is special coins
  --we reserve memory by adding 9999 seconds
  
  pmem(i,math.ceil(records[i]*1000)+spc)
  
 end

 for h in ipairs(hats) do
  if hats[h].owned == true then
   pmem(128+h,1)
  end
 end
 
 pmem(254,deaths)

 pmem(255,phat-1)

end


function loadgame()
 
 basiccoins = pmem(0)

 for i=1,#records do
  local grab = pmem(i)
  if grab >=999999 then
   spcoins[i] = true
   grab = grab-999999
  end
  if grab/1000 <1 then 
   records[i] = 0
  else
   records[i]= grab/1000 + 1
  end
 end
 
 for i=0,#hats do
  if pmem(i+128) == 1 then
   hats[i].owned = true
  end
 end
 
 deaths = pmem(254)
 
 phat = pmem(255)+1

end

function cascadereveal(x,y)
 local repl={104,8,14,104,167,107,30}
 
 mset(x//8,y//8+(level-1)*34,repl[world])
 
 spawnparticle(x,y,0,0,0,0,50,5,10,false,10,4)
 spawnparticle(x,y,0,-1,0,0,50,5,8,false,5,4)

 
 if mget(x//8+1,y//8+(level-1)*34) == 187 then
  mset(x//8+1,y//8+(level-1)*34,repl[world])
  cascadereveal(x+8,y)
  
 end
 
 if mget(x//8-1,y//8+(level-1)*34) == 187 then
  mset(x//8-1,y//8+(level-1)*34,repl[world])
  cascadereveal(x-8,y)
 end
 
 if mget(x//8,y//8+1+(level-1)*34) == 187 then
  mset(x//8,y//8+1+(level-1)*34,repl[world])
  cascadereveal(x,y+8)
 end
 
 if mget(x//8,y//8-1+(level-1)*34) == 187 then
  mset(x//8,y//8-1+(level-1)*34,repl[world])
  cascadereveal(x,y-8)
 end
 

end
